import {
  HiOutlineViewGrid,
  HiOutlineCube,
  HiOutlineShoppingCart,
  HiOutlineUsers,
  HiOutlineDocumentText,
  HiOutlineAnnotation,
  HiOutlineQuestionMarkCircle,
  HiOutlineCog,
} from "react-icons/hi";
import { FaDoorOpen } from "react-icons/fa";
import { MdSpaceDashboard, MdLocalPolice  } from "react-icons/md";
import { IoCalendar, IoExit  } from "react-icons/io5";
import { FaClipboardUser } from "react-icons/fa6";
import { SiTask } from "react-icons/si";
import { RiShieldUserFill, RiSettingsFill  } from "react-icons/ri";




export const DASHBOARD_SIDEBAR_LINKS = [
  {
    key: "dashboard",
    label: "Dashboard",
    path: "/",
    icon: <MdSpaceDashboard  />,
  },
  {
    key: "leave",
    label: "Leave",
    path: "/leave",
    icon: <FaDoorOpen />,
  },
  {
    key: "attendance",
    label: "Attendance",
    path: "/attendance",
    icon: <IoCalendar />,
  },
  {
    key: "myinfo",
    label: "My Info",
    path: "/myinfo",
    icon: <FaClipboardUser />,
  },
  {
    key: "task",
    label: "Task",
    path: "/task",
    icon: <SiTask/>,
  },
  {
    key: "admin",
    label: "Admin",
    path: "/admin",
    icon: <RiShieldUserFill  />,
  },
  {
    key: "claim",
    label: "Claim",
    path: "/claim",
    icon: <MdLocalPolice  />,
  },
];

export const DASHBOARD_SIDEBAR_BOTTOM_LINKS = [
  {
    key: "setting",
    label: "Settings",
    path: "/setting",
    icon: <RiSettingsFill />,
  },
  {
    key: "logout",
    label: "Log out",
    path: "/logout",
    icon: <IoExit  />,
  },
];
